/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';

const Story = () => (
  <div className="container col-12 col-md-1" style={{ width: '600px', marginTop: '1rem' }}>
    <h1 style={{
      fontFamily: 'Arial, sans-serif', fontSize: '50px', fontWeight: 'bold', backgroundColor: '#2AA5A0', backgroundImage: 'linear-gradient(90deg, #E3535D, #2AA5A0)', webkitBackgroundClip: 'text', webkitTextFillColor: 'transparent',
    }}
    >
      Как всё начиналось
    </h1>
    <br />
    <p>
      В давние времена в мир обычных смертных вошли сущности,
      которые внешне ничем не отличались от людей
    </p>
  </div>
);

export default Story;
